package org.hibernate.tck.report;import java.util.Arrays;import java.util.Collection;import java.util.Collections;import java.util.Set;import org.hibernate.tck.annotations.SpecAssertion;import org.hibernate.tck.annotations.SpecAssertions;import com.sun.mirror.apt.AnnotationProcessor;import com.sun.mirror.apt.AnnotationProcessorEnvironment;import com.sun.mirror.apt.AnnotationProcessorFactory;import com.sun.mirror.declaration.AnnotationTypeDeclaration;public class CoverageProcessorFactory implements AnnotationProcessorFactory{   private static final Collection<String> supportedAnnotations = Collections.unmodifiableCollection(         Arrays.asList(               SpecAssertion.class.getCanonicalName(),               SpecAssertions.class.getCanonicalName()         )   );      public AnnotationProcessor getProcessorFor(Set<AnnotationTypeDeclaration> annotationTypeDeclarations,         AnnotationProcessorEnvironment env)   {      return new CoverageProcessor(env);   }   public Collection<String> supportedAnnotationTypes()   {      return supportedAnnotations;   }   public Collection<String> supportedOptions()   {      return null;   }}